#include <iostream>
using namespace std;

int main() {
    // Your code here
    return 0;
}

#include <iostream>
#include <cmath>
#include <iomanip>

int main() {
    int N;
    std::cin >> N;

    double R = sqrt(N);

    std::cout << "The square root of " << N << " is " 
              << std::fixed << std::setprecision(2) << R << std::endl;

    return 0;
}

